import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { useParams } from "react-router-dom";
import { fetchDetails } from "../../../utils/utils";
import { setTvSeason } from "../../../slices/TvShowSlice";

const SeasonList = () => {
  const dispatch = useDispatch();
  const { id } = useParams();

  useEffect(() => {
    async function fetchDataFunction() {
      const result = await fetchDetails(`tv/${id}/season/1?language=en-US`);
      dispatch(setTvSeason(result));
    }

    fetchDataFunction();
  }, [id]);

  const seasons = useSelector((state) => state.series.tvSeason.data);

  return <div>SeasonList</div>;
};

export default SeasonList;
